/*========== MEDIAS FRAMES ==========*/
function mediaFrames(){
  $('.vimeo, .youtube, .dailymotion').not('.loaded').addClass('loaded').each(function(){
	  var container = $(this);
	  var caption = container.find('.top-left');
	  var frame = document.createElement('iframe');
	  var id = $(this).attr('id');
	
	  if ($(this).hasClass('vimeo')) {
	  frame.src = '//player.vimeo.com/video/'+id+'?portrait=0&color=eeeeee&badge=0&byline=0&autoplay=1';	
	  $.ajax({
		  url: 'http://vimeo.com/api/v2/video/'+id+'.json?callback=?',
		  dataType:'jsonp',
		  success: function(data){
			  caption.html(data[0].title);
			  container.css({'background-image':'url('+data[0].thumbnail_large+')','background-size':'cover'});
		  }
	  });
	  }
	
	  if ($(this).hasClass('youtube')) {
	  frame.src = 'http://www.youtube-nocookie.com/embed/'+id+'?rel=0&autoplay=1&theme=light&color=red';	
	  $.ajax({

		  url: 'http://gdata.youtube.com/feeds/api/videos/'+id+'?v=2&alt=json&field=title',
		  dataType:'jsonp',
		  success: function(data){
			  caption.html(data.entry.title.$t);
			  container.css({'background-image':'url(http://img.youtube.com/vi/'+id+'/hqdefault.jpg)','background-size':'cover'});
		  }
	  });
	  }
	
	  if ($(this).hasClass('dailymotion')) {
	  frame.src = 'http://www.dailymotion.com/embed/video/'+id+'?related=0&autoplay=1';	
	  $.ajax({

		  url: 'https://api.dailymotion.com/video/'+id+'?fields=title,thumbnail_360_url',
		  dataType:'jsonp',
		  success: function(data){
			  caption.html(data.title);
			  container.css({'background-image':'url('+data.thumbnail_360_url+')','background-size':'cover'});
		  }
	  });
	  }
	
	  container.find('.center-center').click(function(e){
		  e.preventDefault();
		  $(this).find('i').removeClass('fa-play').addClass('fa-cog fa-spin');
		  caption.hide();
		  container[0].appendChild(frame);
		  container.find('iframe').load(function(){container.find('.center-center').hide();});
	  });
  });
  $('.bandcamp').not('.loaded').addClass('loaded').each(function(){
	  var bandcamp = document.createElement('iframe');
	  bandcamp.src = 'http://bandcamp.com/EmbeddedPlayer/album='+$(this).attr('id')+'/size=medium/bgcol=ffffff/linkcol=333333/transparent=true/track='+$(this).attr('data-track');
	  $(this)[0].appendChild(bandcamp);
  });
  $('.soundcloud').not('.loaded').addClass('loaded').each(function(){
	  var soundcloud = document.createElement('iframe');
	  soundcloud.src = 'https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/'+$(this).attr('data-mode')+'/'+$(this).attr('id')+'&amp;color=333333&amp;auto_play=false&amp;hide_related=false&amp;show_artwork=true';
	  $(this)[0].appendChild(soundcloud);
  });
}
mediaFrames();
/*========== /MEDIAS FRAMES ==========*/

/*========== SLIDER/IMG ==========*/
function sliders(){
  $('.slider').not('.loaded').addClass('loaded').each(function(index){
	  var frame =  $(this);
	  var container =  frame.children('.swiper-container');
	  var toggle = container.children('.top-right')
	  var slider = container.swiper({mode:'horizontal',loop: true, pagination:'#pagination'+container.attr('id'),paginationClickable:1,grabCursor:1,keyboardControl:1});
	  container.children('.center-left').click(function(e){slider.swipePrev();e.preventDefault()});
	  container.children('.center-right').click(function(e){slider.swipeNext();e.preventDefault()});
	
	  toggle.click(function(e){
		  if (!frame.hasClass('fullscreen'))  {$('html, body').css('overflow','hidden');$('#layer').show();frame.css({'height':$(window).height()-20,'width':$(window).width()-20,'margin':0,'top':10,'left':10,'z-index':1000,'position':'fixed'})}
		  else if (frame.hasClass('fullscreen')) {$('html, body').css('overflow','visible');$('#layer').hide();frame.removeAttr('style');$('html, body').scrollTop(frame.offset().top-($(window).height()/2)+110)}
		  frame.toggleClass('fullscreen');
		  e.preventDefault();
		  slider.resizeFix()
	  });
	
	  $(document).keyup(function(e){
		  if(e.keyCode === 27)
			  if (frame.hasClass('fullscreen')) {e.preventDefault();$('html, body').css('overflow','visible').scrollTop(frame.offset().top);$('#layer').hide();frame.removeClass('fullscreen').removeAttr('style');slider.resizeFix();$('html, body').scrollTop(frame.offset().top-($(window).height()/2)+110)}
	  });
	  $(window).resize(function() {
		  if (frame.hasClass('fullscreen')) {frame.css({'height':$(window).height()-20,'width':$(window).width()-20});}
		  slider.resizeFix();
	  });
  });
  $('.swiper-slide').not('.loaded').addClass('loaded').each(function(){
	  $(this).css('background-image','url('+$(this).attr('data-bg')+')');
  });
  $('.spip_image').not('.loaded').addClass('loaded').each(function(){
	  $(this).css('background-image','url('+$(this).attr('data-bg')+')');
	  $(this).children('img').attr('src',$(this).children('img').attr('data-src'));
	  
	  if ($(this).find('.top-right').length) {
	    var frame =  $(this);
	    var toggle = frame.children('.top-right')
	    var style = frame.attr('style');
	    var hd = toggle.attr('href')
	    toggle.click(function(e){
	      if (!frame.hasClass('fullscreen'))  {$('html, body').css('overflow','hidden');$('#layer').show();frame.css({'background-color':'transparent','background-image':'url('+hd+')','height':$(window).height()-20,'width':$(window).width()-20,'margin':0,'top':10,'left':10,'z-index':1000,'position':'fixed'})}
	      else if (frame.hasClass('fullscreen')) {$('html, body').css('overflow','visible');$('#layer').hide();frame.attr('style',style);$('html, body').scrollTop(frame.offset().top-($(window).height()/2)+110)}
		    frame.toggleClass('fullscreen');
		    e.preventDefault();
	    });
	    $(document).keyup(function(e){
		    if(e.keyCode === 27)
          if (frame.hasClass('fullscreen')) {$('html, body').css('overflow','visible');$('#layer').hide();frame.removeClass('fullscreen').attr('style',style);$('html, body').scrollTop(frame.offset().top-($(window).height()/2)+110)}
	    });
	    $(window).resize(function() {
		    if (frame.hasClass('fullscreen')) {frame.css({'height':$(window).height()-20,'width':$(window).width()-20});}
	    });
	  
	  }
  });

}
sliders();

/*========== /SLIDERS/IMG ==========*/

/*========== ARTICLES LIST (ajax) ==========*/
$.modal.defaults.showSpinner=false;

if (window.location.hash.length>1) {
  if ($(window.location.hash).hasClass('sub-article')) {
    $(window.location.hash).addClass('focus').parents('.sub-article').addClass('focus');
  }
}
function ajaxListInit() {
	$('.sub-article-list').each(function(){
		var list = $(this);
		list.find('.modal-keywords a, .sub-article-keywords a, a.lien_pagination').off('click.ajax').on('click.ajax',function(e){e.preventDefault();ajaxList(list.attr('id'),$(this).attr('href'))});
	  $('.modal-keywords').appendTo('body');
	  $('a[rel="modal:open"]').each(function(){
	    $(this).attr('href','#'+$(this).attr('href').split("#")[1]);
	  });
	});
}
ajaxListInit();
function ajaxList(id, target) {
	var list = $('#'+id);
	var container = list.parent('div');
	var target = target.substr(0,target.indexOf('#')); 
	list.addClass('loading');container.load(target+' #'+id,function(response,status,xhr){list.removeClass('loading');if ( status == "error" ) {list.html('ERROR')}});
}
$(document).ajaxComplete(function(){
  mediaFrames();
  sliders();
	ajaxListInit();
	anchors();
	syntaxRefresh();
});
/*========== /ARTICLES LIST (ajax) ==========*/

/*========== ANCHORS SCROLLING ==========*/
var anchors = function() {
  $('a[href*=#]').off('click.scroll').on('click.scroll',function(e){
    if ($(this).attr('href').length>1) {
      var scroll = true;
      var id = '#'+$(this).attr('href').split("#")[1]
      
      if ($(id).hasClass('sub-article')) {
        $(id).parent('.sub-article-list').children('.sub-article').not($(id)).removeClass('focus');
        $(id).toggleClass('focus');
        if ($(id).offset().top < $("body,html").scrollTop()) { $("body,html").stop().scrollTop($(id).offset().top);return}
        if (!$(id).hasClass('focus')) {scroll = false;}
      }
      if (scroll) {
        var y = $(id).offset().top
        var s = Math.min(800,Math.max(100,Math.abs(800 / ($('.home-container').height()/(y-$(window).scrollTop())))))
        $("body,html").stop().animate({scrollTop:y},s,"swing");
      }
      

    }
    e.preventDefault();
  });
}
anchors();
/*========== /ANCHORS SCROLLING ==========*/

/*========== SYNTAX HILIGHTER ==========*/
function syntaxLoad() {
  if ($('.syntax').length) {
    $.getScript(SyntaxRoot + "jquery.syntax.min.js", function () {
    syntaxRefresh();
    });
  }
}
function syntaxRefresh(){
  if ($('.syntax').length) {
    $.syntax({root: SyntaxRoot, inlineLayout: "fixed",theme: "paper"});
  }
}
/*========== /SYNTAX HILIGHTER ==========*/

syntaxLoad();
